def scatter_plot(run_id):
    settings = {
        "allreduce": {
            "fmt": "bo",
            "label": "Allreduce",
            "include": True,
        },
        "tree": {
            "fmt": "ro",
            "label": "Binary Tree Summation",
            "include": True
        },
        "reproblas": {
            "fmt": "co",
            "label": "ReproBLAS",
            "include": True
        }
    }
    f = plt.figure(figsize=(4.5,5.0))
    ax = f.subplots(1)
    ax.set_ylabel('Accumulate Time')
    ax.set_xlabel('number of summands')

    formatter0 = EngFormatter(unit='s', places=0)
    formatter1 = EngFormatter(places=0)
    ax.set_xscale('log', base=2)
    ax.set_yscale('log', base=10)
    ax.yaxis.set_major_formatter(formatter0)
    ax.grid(axis='y', which='both', linewidth=0.4)

    for mode, v in settings.items():
        if not v["include"]:
            continue

        cur.execute("SELECT id, n_summands FROM results WHERE run_id = ? AND mode = ?", (run_id, mode))
        result = cur.fetchall()
        ar_x = []
        ar_y = []
        ar_error_l = []
        ar_error_h = []
        for result_id, n_summands in result:
            cur.execute("SELECT time_ns FROM durations WHERE result_id = ?", (result_id, ))
            durations = sorted(list(map(select(0, convert_from_ns=True), cur.fetchall())))

#            cutoff = int(0.05 * len(durations))
#
#            if cutoff >= 1:
#                durations = durations[cutoff:-cutoff]
#
            

            ar_x.append(n_summands)
            ar_y.append(np.median(durations))
            l, h = np.percentile(durations, 0.01), np.percentile(durations, 0.99)
            ar_error_l.append(l)
            ar_error_h.append(h)

        ax.errorbar(ar_x, ar_y, yerr=(ar_error_l, ar_error_h), fmt=v["fmt"], label=v["label"], capsize=4.0)

    ax.legend(loc='upper left')

    #ax.set_xlim(left=0)
    #ax.set_ylim(bottom=0)

    f.tight_layout()
    return f

def violin_plot(run_id, datasetQuery):
    plot_data = fetch_durations(run_id, datasetQuery)
    rows = len(plot_data)
    cols = max(map(lambda x: len(x), plot_data))
    formatter0 = EngFormatter(unit='s', places=2)

    f, axs = plt.subplots(nrows=rows, figsize=(7, 4 * rows))

    i = 0

    colorpalette = ["#034670ff", "#2f779dff", "#887006ff", "#ac360bff"]

    for dataset in plot_data:
        ax = axs[i] if rows > 1 else axs

        mode_durations = list(map(lambda x: x["durations"], dataset))

        ax.set_ylabel("Time")
        ax.yaxis.set_major_formatter(formatter0)
        ax.xaxis.can_zoom = False

        ax.get_xaxis().set_visible(True)

        # Ticks for each mode
        ax.get_xaxis().set_ticks(range(1, len(dataset)+1))

        medians = list(map(lambda d: median(d), mode_durations))
        labels = map(lambda x: x["mode"] + f" ({formatter0.format_eng(median(x['durations']))}s)", dataset)
        ax.get_xaxis().set_ticklabels(labels)


        #ax.yaxis.set_ticks(y_ticks)
        #ax.yaxis.set_ticks_position('both')
        #plt.setp(ax.get_yticklabels(), rotation=30, horizontalalignment='right')

        n = format(dataset[0]["n"], ",d").replace(",", " ")
        m = dataset[0]["m"]
        filename = dataset[0]["datafile"][5:]
        ax.set_title(f"{filename}, N={n}, p={m}")

        violins = ax.violinplot(mode_durations, showmedians=True, widths=0.5)
        for body, color in zip(violins["bodies"], colorpalette):
            body.set_color(color)

        i += 1
    margin_y = 0.08 / rows
    plt.subplots_adjust(left=0.15, bottom=0.0 + margin_y, right=0.98, top=1.0 - margin_y)
    return f

def slowdown_plot(run_id, faster_mode='reproblas', slower_mode='tree'):
    plot_data = fetch_durations(run_id)
    formatter0 = EngFormatter(places=2)

    X = []
    slowdowns = []

    n_cores = plot_data[0][0]['m']
    for p in plot_data:
        n = p[0]['n']
        mode = lambda mode: (lambda x: x['mode'] == mode)
        slow_data = next(filter(mode(slower_mode), p))
        fast_data = next(filter(mode(faster_mode), p))

        slow_median = median(slow_data['durations'])
        fast_median = median(fast_data['durations'])

        slowdown = slow_median / fast_median
        X.append(n)
        slowdowns.append(slowdown)

    f, ax = plt.subplots(1)

    ax.set_xscale('log', base=2)
    ax.set_ylabel("Slowdown")
    ax.set_xlabel("Number of summands")

    ax.scatter(X, slowdowns)
    ax.axhline(y=1.0, linestyle="--", color="gray")

    return f

def boxplot_comparison(result_ids, labels):
    durations = []
    for result_id, label in zip(result_ids, labels):
        cur.execute("SELECT time_ns FROM durations WHERE result_id = ?", (result_id,))
        results = sorted(map(lambda x: x[0] * 1e-9, cur.fetchall()))[1:-1]
        print(len(results))
        assert(len(results) == 100 - 16 - 2) # 16 results removed by RADTree, outermost outliers removed here
        durations.append(results)
    f, ax = plt.subplots(1,figsize=(6.4,2.0))
    formatter0 = EngFormatter(unit='s')
    ax.xaxis.set_major_formatter(formatter0)
    ax.set_xlabel('Accumulation Time')
    ax.boxplot(durations, vert=False, labels=labels)
    f.tight_layout()
    return f

def last_complete_benchmark(p=256):
    cur.execute("""
        SELECT run.id, COUNT(result.id) FROM runs run, results result
        WHERE result.run_id = run.id
            AND run.cluster_size = ?
            AND description NOT LIKE '%scaling%'
        GROUP BY run.id HAVING COUNT(result.datafile) = 10 * 3
        ORDER BY run.id DESC

        """, (p,))
    return cur.fetchone()[0]

